import React from 'react';


const Toto = ({name,stateMam,repTot}) =>{

    const btnRep = stateMam.messageMaman !== null ? (<button onClick = {repTot}>Réponse</button>) : (<button disabled> Réponse</button>);

    return (
        <div>
            <h2>{name}</h2>
            {btnRep}
            <p>{repTot.messageToto}</p>
        </div>
    )
}

export default Toto;
